INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(1, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', '<p><strong>Địa chỉ</strong>:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7</p>\n<ul>\n<li>Sáng: 7h00 - 12h00</li>\n<li>Chiều: 13h30 - 16h30</li>\n</ul>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.</li>\n<li>Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li>\n<li>Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</li>\n</ul>\n<p><strong>Chi phí khám</strong></p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<ol>\n<li>Gói 1:</li>\n</ol>\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám</li>\n<li>Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</li>\n</ul>\n<ol start=\"2\">\n<li>Gói 2:</li>\n</ol>\n<ul>\n<li>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</li>\n</ul>\n', '**Địa chỉ**:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến thứ 7\n\n* Sáng: 7h00 - 12h00\n* Chiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n\n* Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\n* Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n* Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n\n**Chi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\n1. Gói 1:\n\n* Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\n* Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\n\n2. Gói 2:\n\n* Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám', 'data:image/jpeg;base64,', '2022-12-25 19:16:48', '2022-12-25 19:16:48');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n<p><strong>Bệnh viện có 05 Trung tâm</strong></p>\n<ol>\n<li>Trung tâm Ung bướu Chợ Rẫy.</li>\n<li>Trung tâm Đào tạo – Chỉ đạo tuyến.</li>\n<li>Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.</li>\n<li>Trung tâm Truyền máu Chợ Rẫy.</li>\n<li>Trung tâm Tim mạch.</li>\n</ol>\n<p><strong>38 Khoa Lâm sàng</strong></p>\n<p>04 Khoa khám bệnh ngoại trú:</p>\n<ol>\n<li>Khoa Khám bệnh I</li>\n<li>Khoa Khám bệnh II</li>\n<li>Khoa Chăm sóc sức khỏe theo yêu cầu.</li>\n<li>Khoa Khám xuất cảnh.</li>\n</ol>\n<p>34 Khoa lâm sàng.</p>\n<ol>\n<li>Khoa Phẫu thuật – gây mê hồi sức.</li>\n<li>Khoa Hồi sức – phẫu thuật tim.</li>\n<li>Khoa Phẫu thuật mạch máu.</li>\n<li>Khoa Hồi sức cấp cứu.</li>\n<li>Khoa Hồi sức ngoại thần kinh.</li>\n<li>Khoa Chấn thương sọ não.</li>\n<li>Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).</li>\n<li>Khoa Ngoại Tiêu hóa.</li>\n<li>Khoa Gan Mật Tụy.</li>\n<li>Khoa Ngoại Tiết Niệu.</li>\n<li>Khoa Chấn thương chỉnh hình.</li>\n<li>Khoa Tai Mũi họng.</li>\n<li>Khoa Tạo hình thẩm mỹ.</li>\n<li>Khoa Mắt.</li>\n<li>Khoa Ngoại lồng ngực.</li>\n<li>Khoa Nội tim mạch.</li>\n<li>Khoa Tim mạch can thiệp và Đơn vị Nhịp học.</li>\n<li>Khoa Nội phổi.</li>\n<li>Khoa Nội thận.</li>\n<li>Khoa Nội tiêu hóa.</li>\n<li>Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.</li>\n<li>Khoa Nội tổng quát (Lầu 9B1).</li>\n<li>Khoa Nội tổng quát – quốc tế (Lầu 10B1).</li>\n<li>Khoa Nội tổng quát (Lầu 10B3).</li>\n<li>Khoa Điều trị theo yêu cầu (T6).</li>\n<li>Khoa Bệnh nhiệt đới và Đơn vị Chống độc.</li>\n<li>Khoa Nghiên cứu &amp; điều trị viêm gan.</li>\n<li>Khoa Phỏng – tạo hình.</li>\n<li>Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.</li>\n<li>Khoa Nội cơ xương khớp.</li>\n<li>Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.</li>\n<li>Khoa Cấp cứu.</li>\n<li>Khoa Thận nhân tạo.</li>\n<li>Khoa Vật lý trị liệu.</li>\n</ol>\n<p><strong>Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...</strong></p>\n<ul>\n<li>Bệnh Thần kinh</li>\n<li>Bệnh Cơ xương khớp</li>\n<li>Bệnh tiêu hóa</li>\n<li>Tim mạch</li>\n<li>Phổi</li>\n<li>Thận</li>\n<li>Gan mật</li>\n<li>Thận - Tiết niệu</li>\n<li>Tai Mũi Họng</li>\n<li>Chấn thương chỉnh hình</li>\n<li>Mắt</li>\n<li>Bệnh truyền nhiễm</li>\n<li>Nội tiết</li>\n<li>...</li>\n</ul>\n', 'Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n**Bệnh viện có 05 Trung tâm**\n\n1. Trung tâm Ung bướu Chợ Rẫy.\n2. Trung tâm Đào tạo – Chỉ đạo tuyến.\n3. Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\n4. Trung tâm Truyền máu Chợ Rẫy.\n5. Trung tâm Tim mạch.\n\n**38 Khoa Lâm sàng**\n\n04 Khoa khám bệnh ngoại trú:\n\n1. Khoa Khám bệnh I\n2. Khoa Khám bệnh II\n3. Khoa Chăm sóc sức khỏe theo yêu cầu.\n4. Khoa Khám xuất cảnh.\n\n34 Khoa lâm sàng.\n\n1. Khoa Phẫu thuật – gây mê hồi sức.\n2. Khoa Hồi sức – phẫu thuật tim.\n3. Khoa Phẫu thuật mạch máu.\n4. Khoa Hồi sức cấp cứu.\n5. Khoa Hồi sức ngoại thần kinh.\n6. Khoa Chấn thương sọ não.\n7. Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\n8. Khoa Ngoại Tiêu hóa.\n9. Khoa Gan Mật Tụy.\n10. Khoa Ngoại Tiết Niệu.\n11. Khoa Chấn thương chỉnh hình.\n12. Khoa Tai Mũi họng.\n13. Khoa Tạo hình thẩm mỹ.\n14. Khoa Mắt.\n15. Khoa Ngoại lồng ngực.\n16. Khoa Nội tim mạch.\n17. Khoa Tim mạch can thiệp và Đơn vị Nhịp học.\n18. Khoa Nội phổi.\n19. Khoa Nội thận.\n20. Khoa Nội tiêu hóa.\n21. Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\n22. Khoa Nội tổng quát (Lầu 9B1).\n23. Khoa Nội tổng quát – quốc tế (Lầu 10B1).\n24. Khoa Nội tổng quát (Lầu 10B3).\n25. Khoa Điều trị theo yêu cầu (T6).\n26. Khoa Bệnh nhiệt đới và Đơn vị Chống độc.\n27. Khoa Nghiên cứu & điều trị viêm gan.\n28. Khoa Phỏng – tạo hình.\n29. Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\n30. Khoa Nội cơ xương khớp.\n31. Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\n32. Khoa Cấp cứu.\n33. Khoa Thận nhân tạo.\n34. Khoa Vật lý trị liệu.\n\n**Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...**\n\n* Bệnh Thần kinh\n* Bệnh Cơ xương khớp\n* Bệnh tiêu hóa\n* Tim mạch\n* Phổi\n* Thận\n* Gan mật\n* Thận - Tiết niệu\n* Tai Mũi Họng\n* Chấn thương chỉnh hình\n* Mắt\n* Bệnh truyền nhiễm\n* Nội tiết\n* ...', 'data:image/jpeg;base64,', '2022-12-25 19:22:59', '2022-12-25 19:22:59');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', 'Phòng khám Bệnh viện Đại học Y Dược 1', '<p><strong>Địa chỉ:</strong> 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong></p>\n<ul>\n<li>Thứ 2 tới thứ 6: 07h30 - 16h30</li>\n<li>Thứ 7: 07h30 - 12h00</li>\n</ul>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.</li>\n<li>Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</li>\n</ul>\n<p>Phòng khám Bệnh viện Đại học Y Dược 1 là phòng khám đa khoa, chuyên về Nội khoa. Một số chuyên khoa thế mạnh của phòng khám có thể kể đến như:</p>\n<ul>\n<li>Các gói khám sức khỏe định kỳ cho cá nhân và doanh nghiệp</li>\n<li>Chẩn đoán hình ảnh: chụp Xquang, cộng hưởng từ MRI, cắt lớp vi tính CT-Scan, siêu âm tim, siêu âm.</li>\n<li>Cơ Xương Khớp</li>\n<li>Hô hấp &amp; Dị ứng Miễn dịch</li>\n<li>Nhi khoa</li>\n<li>Nội Tiêu hóa - Viêm gan</li>\n<li>Sản - Phụ khoa</li>\n<li>Tai Mũi Họng</li>\n<li>Tim mạch.</li>\n</ul>\n', '**Địa chỉ:** 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**\n\n* Thứ 2 tới thứ 6: 07h30 - 16h30\n* Thứ 7: 07h30 - 12h00\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.\n\n**Lưu ý quan trọng**\n\n* Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. \n* Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.\n\nPhòng khám Bệnh viện Đại học Y Dược 1 là phòng khám đa khoa, chuyên về Nội khoa. Một số chuyên khoa thế mạnh của phòng khám có thể kể đến như:\n\n* Các gói khám sức khỏe định kỳ cho cá nhân và doanh nghiệp\n* Chẩn đoán hình ảnh: chụp Xquang, cộng hưởng từ MRI, cắt lớp vi tính CT-Scan, siêu âm tim, siêu âm. \n* Cơ Xương Khớp\n* Hô hấp & Dị ứng Miễn dịch\n* Nhi khoa\n* Nội Tiêu hóa - Viêm gan\n* Sản - Phụ khoa\n* Tai Mũi Họng\n* Tim mạch.', 'data:image/jpeg;base64,', '2022-12-25 19:26:13', '2022-12-25 19:26:13');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, '9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội', 'Bệnh viện K - Cơ sở Phan Chu Trinh', '<p><strong>Địa chỉ:</strong> 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7 (6h00 - 17h00)</p>\n<p>Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:</p>\n<p>Cấp cứu, khám bệnh, chữa bệnh, phòng bệnh\nPhục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.\nĐào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.\nNghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.</p>\n<p><strong>Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau:</strong></p>\n<ol>\n<li>Gói 1:</li>\n</ol>\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khám</li>\n</ul>\n<ol start=\"2\">\n<li>Gói 2:</li>\n</ol>\n<ul>\n<li>Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khám</li>\n</ul>\n<ol start=\"3\">\n<li>Gói 3:</li>\n</ol>\n<p><strong>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám</strong></p>\n<p>Bệnh viện có thế mạnh Khám, sàng lọc, điều trị các bệnh lý ung thư:</p>\n<ul>\n<li>Ung thư đầu cổ</li>\n<li>Ung thư tuyến giáp</li>\n<li>Ung thư vú</li>\n<li>Ung thư phổi</li>\n<li>Ung thư gan</li>\n<li>Ung thư đường tiêu hóa</li>\n<li>Ung thư buồng trứng, ccổ tử cung</li>\n<li>Ung thư tuyến tiền liệt</li>\n</ul>\n', '**Địa chỉ:** 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến thứ 7 (6h00 - 17h00)\n\nBệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:\n\nCấp cứu, khám bệnh, chữa bệnh, phòng bệnh\nPhục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.\nĐào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.\nNghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.\n\n**Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau:**\n\n1. Gói 1:\n\n* Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khám\n\n2. Gói 2:\n\n* Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khám\n\n3. Gói 3:\n\n**Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám**\n\nBệnh viện có thế mạnh Khám, sàng lọc, điều trị các bệnh lý ung thư:\n\n* Ung thư đầu cổ\n* Ung thư tuyến giáp\n* Ung thư vú\n* Ung thư phổi\n* Ung thư gan\n* Ung thư đường tiêu hóa\n* Ung thư buồng trứng, ccổ tử cung\n* Ung thư tuyến tiền liệt', 'data:image/jpeg;base64,', '2022-12-25 19:28:34', '2022-12-25 19:28:34');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Bệnh viện Ung bướu Hưng Việt', '<p><strong>Địa chỉ:</strong> Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong> Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<p>Buổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Một trong những điểm mạnh giúp Bệnh viên Ung bướu Hưng Việt trở thành điểm sáng về khám chữa bệnh là đội ngũ y bác sĩ giỏi uy tín. Các bác sĩ trực tiếp thăm khám, phẫu thuật cho bệnh nhân đều là những chuyên gia đã đang làm việc tại các bệnh viện lớn như: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Đại học Y Hà Nội, Bệnh viện Hữu nghị Việt Đức, Bệnh viên Quân đội 108,...</p>\n<p>Bên cạnh đó, bệnh nhân có thể an tâm tới khám và điều trí nội trú, ngoại trú vì bệnh viện hệ thống cơ sở vật chất đầy đủ, tiên nghi đạt tiêu chuẩn tiên tiến song song với đó là trang thiết bị y tế hiện đại nhập khẩu từ Mỹ, Châu Âu.\nBệnh viện có thế mạnh về khám chữa bệnh, kiểm tra sức khỏe định kỳ, khám sàng lọc phát hiện ung thư sớm; phẫu thuật các bệnh khối u và ung thư, điều trị hóa chất, tia xạ…về:</p>\n<ul>\n<li>Tiêu hóa - Gan - Mật</li>\n<li>Nội tiết</li>\n<li>Tai - Mũi - Họng</li>\n<li>Hô hấp</li>\n<li>Tim mạch</li>\n<li>Phụ khoa</li>\n<li>Thần kinh cột sống</li>\n<li>Tiết Niệu - Thận</li>\n</ul>\n', '**Địa chỉ:** Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc:** Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\nBuổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nMột trong những điểm mạnh giúp Bệnh viên Ung bướu Hưng Việt trở thành điểm sáng về khám chữa bệnh là đội ngũ y bác sĩ giỏi uy tín. Các bác sĩ trực tiếp thăm khám, phẫu thuật cho bệnh nhân đều là những chuyên gia đã đang làm việc tại các bệnh viện lớn như: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Đại học Y Hà Nội, Bệnh viện Hữu nghị Việt Đức, Bệnh viên Quân đội 108,...\n\nBên cạnh đó, bệnh nhân có thể an tâm tới khám và điều trí nội trú, ngoại trú vì bệnh viện hệ thống cơ sở vật chất đầy đủ, tiên nghi đạt tiêu chuẩn tiên tiến song song với đó là trang thiết bị y tế hiện đại nhập khẩu từ Mỹ, Châu Âu.\nBệnh viện có thế mạnh về khám chữa bệnh, kiểm tra sức khỏe định kỳ, khám sàng lọc phát hiện ung thư sớm; phẫu thuật các bệnh khối u và ung thư, điều trị hóa chất, tia xạ…về:\n\n* Tiêu hóa - Gan - Mật\n* Nội tiết\n* Tai - Mũi - Họng\n* Hô hấp\n* Tim mạch\n* Phụ khoa\n* Thần kinh cột sống\n* Tiết Niệu - Thận', 'data:image/jpeg;base64,', '2022-12-27 22:23:22', '2022-12-27 22:23:22');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, '42 Nghĩa Dũng, Phúc xá, Ba Đình, Hà Nội', 'Hệ thống y tế MEDLATEC', '<p>Hệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 06 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:</p>\n<ul>\n<li>Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội</li>\n<li>Phòng khám Đa khoa MEDLATEC Tây Hồ</li>\n<li>Phòng khám Đa khoa MEDLATEC Thanh Xuân</li>\n<li>Phòng khám Đa khoa MEDLATEC Vĩnh Phúc</li>\n<li>Phòng khám Đa khoa MEDLATEC Mê Linh</li>\n<li>Phòng khám Đa khoa MEDLATEC Bắc Ninh</li>\n<li>Phòng khám Đa khoa MEDLATEC Thanh Hóa</li>\n<li>Các chi nhánh, văn phòng, điểm thu gom mẫu</li>\n</ul>\n<p><strong>Bệnh viện Đa khoa MEDLATEC</strong></p>\n<ul>\n<li>\n<p><strong>Địa chỉ:</strong> 42 Nghĩa Dũng, Ba Đình, Hà Nội.</p>\n</li>\n<li></li>\n<li>\n<p><strong>Thời gian làm việc</strong>: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.</p>\n</li>\n<li></li>\n<li>\n<p><strong>Các dịch vụ y tế cung cấp:</strong></p>\n</li>\n<li>\n<p>Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...</p>\n</li>\n<li>\n<p>Phẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.</p>\n</li>\n<li>\n<p>Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner),thăm dò chức năng (Điện tim, Nội soi,…),xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)</p>\n</li>\n<li>\n<p>Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.</p>\n</li>\n<li>\n<p>Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…</p>\n</li>\n<li>\n<p>Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.</p>\n</li>\n<li>\n<p>Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...</p>\n</li>\n</ul>\n<p><strong>Phòng khám Đa khoa tại Hà Nội và tỉnh</strong></p>\n<p><strong>Thời gian làm việc:</strong> Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.</p>\n<p><strong>Các dịch vụ y tế cung cấp tại phòng khám đa khoa:</strong></p>\n<ul>\n<li>Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...</li>\n<li>Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, CT-Scanner),thăm dò chức năng (Điện tim, Nội soi,…),xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử,...)</li>\n<li>Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.</li>\n<li>Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…</li>\n<li>Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc (áp dụng tại PKĐK MEDLATEC Tây Hồ) và Bảo lãnh viện phí (tại PKĐK MEDLATEC Vĩnh Phúc)</li>\n<li>Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai (áp dụng tại PKĐK MEDLATEC Tây Hồ, MEDLATEC Thanh Xuân).</li>\n</ul>\n<p><strong>Phục vụ lấy mẫu xét nghiệm tận nơi 24/24</strong></p>\n<p><strong>Thời gian:</strong> 24/24h, tất cả các ngày trong tuần, kể cả ngày Lễ/Tết.</p>\n<p><strong>Địa điểm phục vụ:</strong> Tại hệ thống văn phòng và chuỗi chi nhánh ở các tỉnh, thành phố.</p>\n', 'Hệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 06 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:\n\n* Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\n* Phòng khám Đa khoa MEDLATEC Tây Hồ\n* Phòng khám Đa khoa MEDLATEC Thanh Xuân\n* Phòng khám Đa khoa MEDLATEC Vĩnh Phúc\n* Phòng khám Đa khoa MEDLATEC Mê Linh\n* Phòng khám Đa khoa MEDLATEC Bắc Ninh\n* Phòng khám Đa khoa MEDLATEC Thanh Hóa\n* Các chi nhánh, văn phòng, điểm thu gom mẫu\n\n**Bệnh viện Đa khoa MEDLATEC**\n\n* **Địa chỉ:** 42 Nghĩa Dũng, Ba Đình, Hà Nội.\n* \n* **Thời gian làm việc**: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\n* \n* **Các dịch vụ y tế cung cấp:**\n\n* Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\n* Phẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.\n* Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner),thăm dò chức năng (Điện tim, Nội soi,…),xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)\n* Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\n* Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\n* Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.\n* Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...\n\n**Phòng khám Đa khoa tại Hà Nội và tỉnh**\n\n**Thời gian làm việc:** Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\n\n**Các dịch vụ y tế cung cấp tại phòng khám đa khoa:**\n\n* Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\n* Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, CT-Scanner),thăm dò chức năng (Điện tim, Nội soi,…),xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử,...)\n* Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\n* Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\n* Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc (áp dụng tại PKĐK MEDLATEC Tây Hồ) và Bảo lãnh viện phí (tại PKĐK MEDLATEC Vĩnh Phúc)\n* Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai (áp dụng tại PKĐK MEDLATEC Tây Hồ, MEDLATEC Thanh Xuân).\n\n**Phục vụ lấy mẫu xét nghiệm tận nơi 24/24**\n\n**Thời gian:** 24/24h, tất cả các ngày trong tuần, kể cả ngày Lễ/Tết.\n\n**Địa điểm phục vụ:** Tại hệ thống văn phòng và chuỗi chi nhánh ở các tỉnh, thành phố.', 'data:image/jpeg;base64,', '2022-12-27 22:27:30', '2022-12-27 22:27:30');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'Trung tâm xét nghiệm Diag Laboratories', '<p>Diag là một trong những trung tâm xét nghiệm danh tiếng tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.</p>\n<ul>\n<li>Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác</li>\n<li>Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu</li>\n<li>Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe</li>\n<li>Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển</li>\n<li>Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC)</li>\n</ul>\n<p>Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động abbott đảm bảo kết quả nhanh chóng và chính xác. Các trang thiết bị của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Abbott, Roche, Sysmex, Thermo Fisher, Arkray</p>\n<p><strong>Địa chỉ:</strong> Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh</p>\n<p>Trung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>\n<p>Giờ mở cửa: 6h00 mỗi ngày</p>\n</li>\n<li>\n<p>Giờ đóng cửa:</p>\n</li>\n<li>\n<p>Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)</p>\n</li>\n<li>\n<p>Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở),cơ sở Quận 10: 19h00</p>\n</li>\n</ul>\n<p><strong>Hình thức thanh toán:</strong></p>\n<ul>\n<li>Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ</li>\n<li>Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ</li>\n</ul>\n', 'Diag là một trong những trung tâm xét nghiệm danh tiếng tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\n* Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác\n* Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu\n* Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe\n* Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển\n* Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC)\n\nTrung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động abbott đảm bảo kết quả nhanh chóng và chính xác. Các trang thiết bị của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Abbott, Roche, Sysmex, Thermo Fisher, Arkray\n\n**Địa chỉ:** Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\n**Thời gian làm việc:**\n\n* Giờ mở cửa: 6h00 mỗi ngày\n* Giờ đóng cửa:\n\n* Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\n* Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở),cơ sở Quận 10: 19h00\n\n**Hình thức thanh toán:** \n\n* Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\n* Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ', 'data:image/png;base64,', '2022-12-27 22:29:36', '2022-12-27 22:29:36');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(8, 'Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội', 'Hệ thống Y tế Thu Cúc TCI', '<p>Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận</p>\n<ul>\n<li>Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng</li>\n<li>TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội</li>\n<li>TOP 5 bệnh viện có điểm chất lượng cao nhất</li>\n<li>99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế</li>\n</ul>\n<p><strong>Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.</strong></p>\n<ul>\n<li>Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108</li>\n<li>Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li>\n<li>Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị</li>\n<li>Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu</li>\n<li>Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.</li>\n<li>Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.</li>\n</ul>\n<p><strong>Địa chỉ:</strong></p>\n<ul>\n<li>Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội</li>\n<li>Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội</li>\n<li>Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội</li>\n<li>Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc chung:</strong></p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:</p>\n<ul>\n<li><strong>Cơ sở 286 Thụy Khuê:</strong> Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7</li>\n<li><strong>Cơ sở 216 Trần Duy Hưng:</strong> Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li><strong>Cơ sở 32 Đại Từ:</strong> Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li><strong>Cơ sở 136 Nguyễn Trãi:</strong> Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần</li>\n</ul>\n<p><strong>Một số lưu ý</strong></p>\n<ol>\n<li>Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:</li>\n</ol>\n<ul>\n<li>Ưu tiên các trường hợp cấp cứu</li>\n<li>Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.</li>\n<li>Người bệnh đặt hẹn (có dấu đã đặt hẹn)</li>\n<li>Người bệnh khám các dịch vụ khác</li>\n</ul>\n', 'Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận\n\n* Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\n* TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\n* TOP 5 bệnh viện có điểm chất lượng cao nhất\n* 99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\n\n**Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.** \n\n* Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\n* Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\n* Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\n* Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\n* Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\n* Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\n\n**Địa chỉ:**\n\n* Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\n* Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\n* Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\n* Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc chung:**\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:\n\n* **Cơ sở 286 Thụy Khuê:** Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\n* **Cơ sở 216 Trần Duy Hưng:** Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* **Cơ sở 32 Đại Từ:** Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* **Cơ sở 136 Nguyễn Trãi:** Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần\n\n**Một số lưu ý**\n\n1. Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.\n2. Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.\n3. Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:\n\n*  Ưu tiên các trường hợp cấp cứu\n* Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.\n* Người bệnh đặt hẹn (có dấu đã đặt hẹn)\n* Người bệnh khám các dịch vụ khác', 'data:image/jpeg;base64,', '2022-12-27 22:32:32', '2022-12-27 22:32:32');
